from typing import List, Any, Optional
import _discord.emojis as e
import requests
class AlertMenus(disnake.ui.View):
    def __init__(
        self, embeds: List[disnake.Embed], options: List[disnake.ui.Select]
    ):
        super().__init__(timeout=None)
        self.embeds = [] if embeds is None else embeds
        self.options = options
        self.embed_count = 0
        self.prev_page.disabled = True

        for opt in options:
            self.selector.append_option(opt)

        if self.embeds is not None:
            for i, embed in enumerate(self.embeds):
                embed.set_footer(text=f"Page {i + 1} of {len(self.embeds)}")






    @disnake.ui.select(
        placeholder="🇲 🇪 🇳 🇺",
        custom_id=f"select_{str(disnake.Member)}ewfweawf",
        row=3

    )
    async def selector(
        self,
        select: disnake.ui.Select,
        inter: disnake.MessageInteraction,
    ) -> None:

        s = ""
        str1 = s.join(select.values)
        ind = int(str1)
        self.embed_count = ind
        self.next_page.disabled = False
        self.prev_page.disabled = False
        print(select.values)
        if self.embed_count == 0:
            self.prev_page.disabled = True
        if self.embed_count == len(self.embeds) - 1:
            self.next_page.disabled = True
        print(select.values)
        await inter.response.edit_message(embed=self.embeds[ind], view=self)


    @disnake.ui.button(
        emoji="<a:_:1042677512284680321>",
        style=disnake.ButtonStyle.red,
        custom_id=f"persistent_view:prevqwfpage_{str(disnake.Member)}aq2wfwa",
        row=4

    )
    async def prev_page(  # pylint: disable=W0613
        self,
        button: disnake.ui.Button,
        interaction: disnake.MessageInteraction,
    ):
        # Decrements the embed count.
        self.embed_count -= 1

        # Gets the embed object.
        embed = self.embeds[self.embed_count]

        # Enables the next page button and disables the previous page button if we're on the first embed.
        self.next_page.disabled = False

        await interaction.response.edit_message(embed=embed, view=self)


    @disnake.ui.button(
        emoji="<a:_:1042677591196319765>",
        style=disnake.ButtonStyle.red,
        custom_id=f"persistent_view:nextpage_{str(disnake.Member)}awfawwa",
        row=4
    )
    async def next_page(  # pylint: disable=W0613
        self,
        button: disnake.ui.Button,
        interaction: disnake.MessageInteraction,
    ):
        # Increments the embed count.
        self.embed_count += 1

        # Gets the embed object.
        embed = self.embeds[self.embed_count]

        # Enables the previous page button and disables the next page button if we're on the last embed.
        self.prev_page.disabled = False

        await interaction.response.edit_message(embed=embed, view=self)
